import React from 'react';
import classes from './Post.module.css';

const Post = (props) => {
    return (
            <p className={classes.item}> 
            <p className={classese.name}>
              {props.name} 
            </p>           
              {props.message}
              <p className={classes.underItem}>
                Likes: <span className={classes.value}>{props.likes}</span>
              </p>
            </p>    
    );
}
export default Post;
